import React, { useState } from "react";

import "./Form.css"

const Form = ()=>{
    const [name , setName] = useState("Hellw")
    const handler =(evnet)=>{
       console.log(evnet.target.value) 
     
       setName(evnet.target.value)
    }
    
    return(
        <div className="container">
            <h1>{name}</h1>
            <input type="text" onChange={handler} placeholder="Enter your name" /><br /><br />
            <button>Click me</button>
        </div>
    )
}

export default Form
